O Projeto Pedagógico Institucional da UFABC contempla os seguintes pontos:

- Interdisciplinaridade: integração entre as disciplinas de Biologia Celular e Tecidual (BC&T) e Biologia Celular e Histológica (BC&H);
- Regime curricular quadrimestral, que aumenta a dinâmica das disciplinas e amplia a formação dos estudantes;
- Matrizes curriculares flexíveis, concedendo autonomia aos alunos para escolher seu currículo e permitindo a matrícula em disciplinas de outros cursos;
- Cursos pós-Bacharelado: até 3 opções específicas de cursos de especialização ou graduação.

O perfil do egresso do curso de Bacharelado em Ciências e Humanidades (BC&H) inclui:

- Multidisciplinaridade e interdisciplinaridade na formação;
- Competência em autogestão e caráter crítico;
- Habilitação para exercer funções na administração pública e privada, além de em organizações que coordenem esforços para a consecução de metas econômicas, políticas ou sociais;
- Possibilidade de cursar cursos específicos (Pós-Bacharelado) ou graduação.

A seguir, está o resumo do conteúdo:

A UFABC oferece cursos em BC&T (90 créditos - 26 disciplinas) e BC&H (71 créditos - 21 disciplinas). As categorias de disciplinas incluem:
- Disciplinas obrigatórias: devem ser cursadas necessariamente;
- Disciplinas de opção limitada: direcionam para formação específica, com mínimo de 57 créditos em BC&T e 81 créditos em BC&H;
- Disciplina livre: qualquer disciplina da universidade.
Além disso, é apresentado um exemplo de disciplina com sua definição: TPI (BIS0003-15), que abrange Bases Matemáticas, com a fórmula Créditos = T + P.

Os objetivos da UFABC incluem:

* Investimento em cursos de graduação;
* Formar alunos para serem cidadãos globais;
* Contribuir para a qualificação dos alunos como pessoas e membros da sociedade.

O Comitê Local de Acompanhamento e Avaliação Pró-Reitoria de Graduação é responsável pelo Programa de Ensino Tutorial, que tem os seguintes objetivos:

* Formar grupos tutoriais sob orientação do Professor-Tutor;
* Desenvolver atividades extracurriculares para complementar a formação acadêmica;
* Integrar Ações de Ensino, Pesquisa e Extensão.
